script: |
  super -f text -I q6789.spq | sort > q6789.out

inputs:
  - name: q6789.spq
    data: |
      SELECT DISTINCT - 6 + + 33 * ( - col1 ) * + - CAST ( + col0 AS INTEGER ) - + 9 AS col1, 69 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - col2 >= NULL;
  - name: tab2

outputs:
  - name: q6789.out
    data: |
